package javabasics;

class accessmodifier {
	private int a = 10;
	public static int b =20;
	static int c= 30;
	protected int d = 40;
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
				System.out.println(a);
				System.out.println(b);
				System.out.println(c);
				System.out.println(d);
	}

}
